import Header from "../header/Header";
import "./AllRestaurants.scss";
import BeigeCard from "../layout/card/BeigeCard";
import DummyData from "../DummyData";
import { NavLink } from "react-router-dom";
import NavLinkTemplate from "../layout/navLink/NavLinkTemplate";

const AllRestaurants = () => {
  const dummy = [
    {
      key: "m1",
      restaurantImage: "claro",
      restaurantName: "Claro",
      chefName: "Ran Shmueli",
      chefDescription: "",
      chefImage: "",
      signatureName: "pad Ki Mao",
      signatureImage: "padKiMao",
      signatureDescription:
        "Shrimps, Glass Noodles, Kemiri Nuts, Shallots, Lemon Grass, Magic Chili Brown Coconut",
      icon: "vegiterian",
      price: 66,
    },
    {
      key: "m2",
      restaurantImage: "lumina",
      restaurantName: "Lumina",
      chefName: "Meir Adoni",
      chefDescription: "",
      chefImage: "",
      signatureName: "garbanzo",
      signatureImage: "garbanzo",
      signatureDescription:
        "Shrimps, Glass Noodles, Kemiri Nuts, Shallots, Lemon Grass, Magic Chili Brown Coconut",
      icon: "vegiterian",
      price: 25,
    },
    {
      key: "m3",
      restaurantImage: "tiger",
      restaurantName: "Tiger Lilly",
      chefName: "Yanir Green",
      chefDescription: "",
      chefImage: "",
      signatureName: "pizza",
      signatureImage: "pizza",
      signatureDescription:
        "Shrimps, Glass Noodles, Kemiri Nuts, Shallots, Lemon Grass, Magic Chili Brown Coconut",
      icon: "spicy",
      price: 45,
    },
    {
      key: "m4",
      restaurantImage: "tiger",
      restaurantName: "Onza",
      chefName: "Yossi Shitrit",
      chefDescription:
        "Chef Yossi Shitrit has been living and breathing his culinary dreams for more than two decades, including  running the kitchen in his first restaurant, the fondly-remembered  Violet, located in Moshav Udim.  Shitrit's creativity and culinary acumen  born of long experience are expressed in the every detail of each and every dish.",
      chefImage: "yossi",
      signatureName: "pizza",
      signatureImage: "pizza",
      signatureDescription:
        "Shrimps, Glass Noodles, Kemiri Nuts, Shallots, Lemon Grass, Magic Chili Brown Coconut",
      icon: "spicy",
      price: 45,
    },
  ];

  return (
    <div>
      <Header />
      <h2>Restaurants</h2>
      <nav>
        <NavLinkTemplate
          to={"/AllRestaurants"}
          content={"All"}
        ></NavLinkTemplate>
        <NavLinkTemplate to={"/New"} content={"New"}></NavLinkTemplate>
        <NavLinkTemplate
          to={"/MostPopular"}
          content={"Most Popular"}
        ></NavLinkTemplate>
        <NavLinkTemplate to={"/OpenNow"} content={"Open Now"}></NavLinkTemplate>
      </nav>
      <div className="restaurants-grid">
        {dummy.map((prop) => {
          return (
            <BeigeCard
              title={prop.restaurantName}
              detail={prop.chefName}
              img={prop.restaurantImage}
            ></BeigeCard>
          );
        })}
      </div>
    </div>
  );
};

